import './index.css';
import React from "react"
import ReactDOM from 'react-dom';
import App from './App';
import Headings from './Headings'

ReactDOM.render(
    <div>
      <Headings/>
      <div>
        <div><App /></div>
      </div>
    </div>,
    document.getElementById('root')
);
